import axios from 'axios';


export default function idCheck(id) {
    
    axios(
        {
            url: '/user/idCheck',
            method: 'get',
            params:{userId:id},
            baseURL: 'http://52.79.100.79:8888',
            withCredentials: true,
        }
    ).then(function(resource) {
        if(resource.data === true ){
            alert('사용가능한 아이디입니다.');
        }else{
            alert('중복된 아이디입니다.');
        }
      
    });
}
